.cta_arrow {
  opacity: 0.75;
  transition: opacity 0.3s ease;
}

.button-circle-preloader:hover .cta_arrow.is-1,
.button-circle-preloader:hover .cta_arrow.is-4 {
  animation: arrow-fade 0.75s ease-in-out infinite;
  animation-delay: 0s;
}

.button-circle-preloader:hover .cta_arrow.is-2,
.button-circle-preloader:hover .cta_arrow.is-5 {
  animation: arrow-fade 0.75s ease-in-out infinite;
  animation-delay: 0.5s;
}

.button-circle-preloader:hover .cta_arrow.is-3,
.button-circle-preloader:hover .cta_arrow.is-6 {
  animation: arrow-fade 0.75s ease-in-out infinite;
  animation-delay: 1s;
}

@keyframes arrow-fade {
  0%, 50% {
    opacity: 0.25;
  }
  51%, 100% {
    opacity: 1;
  }
}




.button-circle-preloader {
  transition: opacity 0.75s cubic-bezier(0.16, 1, 0.3, 1);
}

.button-circle-content-preloader {
  transition: opacity 0.75s cubic-bezier(0.16, 1, 0.3, 1);
}

.button-circle-texture {
  opacity: 0.15;
  transition: opacity 0.75s cubic-bezier(0.16, 1, 0.3, 1);
}

.button-circle-preloader:active .button-circle-texture {
  opacity: 0;
}

