document.addEventListener("DOMContentLoaded", () => {
  const observer = new IntersectionObserver((entries) => {
    entries.forEach((entry) => {
      const elements = entry.target.querySelectorAll(".blinking-decor-block");
      if (entry.isIntersecting) {
        elements.forEach((el) => el.classList.remove("inactive"));
      } else {
        elements.forEach((el) => el.classList.add("inactive"));
      }
    });
  });

  const target = document.querySelector(".blinking-decor-block-wrap");
  if (target) observer.observe(target);
});

document.addEventListener("DOMContentLoaded", () => {
  const sections = document.querySelectorAll("[data-text-color]");
  const responsiveTexts = document.querySelectorAll("[data-responsive-text='true']");
  const lineMaskLinks = document.querySelectorAll("[line-mask-link]");
  const menu = document.querySelector("[data-menu]");

  const defaultColor = "#070707";
  const defaultBgColor = "transparent";

  responsiveTexts.forEach((textElement) => {
    textElement.style.color = defaultColor;
    textElement.style.backgroundColor = defaultBgColor;
    textElement.style.setProperty("--shadow-color", defaultColor);
  });

  let activeColor = defaultColor;
  let activeBgColor = defaultBgColor;

  function getActiveSection() {
    let foundSection = null;
    sections.forEach((section) => {
      const rect = section.getBoundingClientRect();
      if (rect.top < window.innerHeight * 0.5 && rect.bottom > window.innerHeight * 0.5) {
        foundSection = section;
      }
    });
    return foundSection;
  }

  function updateTextColor() {
    const activeSection = getActiveSection();
    if (activeSection) {
      activeColor = activeSection.getAttribute("data-text-color") || defaultColor;
      activeBgColor = activeSection.getAttribute("data-bg-color") || defaultBgColor;
    } else {
      activeColor = defaultColor;
      activeBgColor = defaultBgColor;
    }

    responsiveTexts.forEach((textElement) => {
      textElement.style.color = activeColor;
      textElement.style.backgroundColor = activeBgColor;
      textElement.style.setProperty("--shadow-color", activeColor);
    });
  }

  const observer = new IntersectionObserver(
    (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          activeColor = entry.target.getAttribute("data-text-color") || defaultColor;
          activeBgColor = entry.target.getAttribute("data-bg-color") || defaultBgColor;
        }
      });

      updateTextColor();
    },
    { threshold: 0.5 }
  );

  sections.forEach((section) => observer.observe(section));

  if (menu) {
    menu.addEventListener("transitionend", updateTextColor);
    menu.addEventListener("click", updateTextColor);
  }

  lineMaskLinks.forEach((link) => {
    const lines = link.querySelectorAll("[line-mask-text]");

    link.addEventListener("mouseenter", function () {
      gsap.to(lines, {
        yPercent: -100,
        duration: 0.2,
        ease: "ease",
        overwrite: true,
      });
    });

    link.addEventListener("mouseleave", function () {
      gsap.to(lines, {
        yPercent: 0,
        duration: 0.2,
        ease: "ease",
      });
    });
  });

  setTimeout(updateTextColor, 100);

  let scrollTimeout;
  window.addEventListener("scroll", () => {
    clearTimeout(scrollTimeout);
    scrollTimeout = setTimeout(updateTextColor, 80);
  });
});

document.addEventListener("DOMContentLoaded", () => {
  const triggerElements = document.querySelectorAll('[data-hover-slide-trigger]');

  triggerElements.forEach((trigger) => {
    const animatedElements = trigger.querySelectorAll('[data-animation="slideup"]');

    animatedElements.forEach((el) => {
      const mask = document.createElement("div");
      mask.classList.add("dynamic-mask");

      const span = document.createElement("span");
      span.innerHTML = el.innerHTML.trim();

      mask.appendChild(span);
      el.innerHTML = "";
      el.appendChild(mask);
    });

    trigger.addEventListener("mouseenter", () => {
      const masks = trigger.querySelectorAll(".dynamic-mask span");
      masks.forEach((span) => {
        const parent = span.closest('[data-animation="slideup"]');
        const delay = parseFloat(parent.getAttribute("slide-delay") || "0");
        const speed = parseFloat(parent.getAttribute("slide-speed") || "0.5");

        span.style.animation = "none";
        void span.offsetWidth;
        span.style.animation = `slideup ${speed}s ${delay}s cubic-bezier(0.785, 0.135, 0.15, 0.86) forwards`;
      });
    });

    trigger.addEventListener("mouseleave", () => {
      const masks = trigger.querySelectorAll(".dynamic-mask span");
      masks.forEach((span) => {
        span.style.animation = "none";
      });
    });
  });
});

document.addEventListener("DOMContentLoaded", () => {
  document.body.addEventListener("contextmenu", (e) => {
    if (e.target.tagName === "IMG" || e.target.tagName === "SVG") {
      e.preventDefault();
    }
  });

  document.querySelectorAll("img, a, svg").forEach(el => {
    el.setAttribute("draggable", "false");
  });
});

document.addEventListener("DOMContentLoaded", () => {
  const preloaderBlack = document.querySelector('.preloader-black');
  const lines = document.querySelectorAll('.preloader_line');
  const blocks = document.querySelectorAll('.is-top-1, .is-top-2, .is-top-3, .is-center-1, .is-center-2-1, .is-center-2-2, .is-center-3, .is-bottom-1, .is-bottom-2, .is-bottom-3');
  const corners = document.querySelector('.preloader_corners');
  const text = document.querySelector('.preloader_text');
  const preloaderButton = document.querySelector('[data-enter-hide]');
  const preloaderEnterButton = document.querySelector('.button-circle-preloader');
  const lottiePreloader = document.querySelector('.lottie_preloader');
  const enterBlock = document.querySelector('.preloader-enter');

  if (preloaderBlack) {
  gsap.to(preloaderBlack, {
    opacity: 0,
    duration: 0.25,
    onComplete: () => {
      preloaderBlack.style.display = "none";
    }
  });
}

  lines.forEach(line => {
    const isTop = line.classList.contains('is-top');
    const isBottom = line.classList.contains('is-bottom');
    const isLeft = line.classList.contains('is-left');
    const isRight = line.classList.contains('is-right');

    if (isTop || isBottom) {
      gsap.fromTo(line,
        { width: 0 },
        { width: '100%', duration: 1.25, delay: 1, ease: 'power2.inOut' }
      );
    } else if (isLeft || isRight) {
      gsap.fromTo(line,
        { height: 0 },
        { height: '100%', duration: 1.25, delay: 1, ease: 'power2.inOut' }
      );
    }
  });

  if (preloaderEnterButton) {
    gsap.delayedCall(5.25, () => {
      preloaderEnterButton.classList.add('is-active');
    });
  }

  preloaderButton?.addEventListener("click", () => {
    const tl = gsap.timeline();

    if (preloaderEnterButton && lottiePreloader) {
      tl.to([preloaderEnterButton, lottiePreloader], {
        scale: 0,
        opacity: 0,
        duration: 0.25,
        ease: "power2.inOut"
      }, 0);
    }

    tl.to(lines, {
      opacity: 0,
      duration: 0.5,
      ease: "power2.out"
    }, 0.25);

    blocks.forEach(block => {
      let props = {};
      if (block.classList.contains('is-top-1') || block.classList.contains('is-bottom-3')) {
        props = { height: 0 };
      } else if (block.classList.contains('is-top-2') || block.classList.contains('is-center-3') || block.classList.contains('is-center-2-2')) {
        props = { width: 0 };
      } else if (block.classList.contains('is-top-3') || block.classList.contains('is-bottom-1')) {
        props = { height: 0 };
      } else if (block.classList.contains('is-center-1') || block.classList.contains('is-bottom-2') || block.classList.contains('is-center-2-1')) {
        props = { width: 0 };
      }
      tl.to(block, { ...props, duration: 1, ease: "power2.inOut" }, 0.25);
    });

    tl.to(corners, {
      opacity: 0,
      duration: 0.1,
      ease: "power1.out"
    }, 0.25);

    tl.to(text, {
      opacity: 0,
      duration: 0.1,
      ease: "power1.out"
    }, 0.25);

    tl.to(enterBlock, {
      opacity: 0,
      duration: 0.2,
      ease: "power1.out",
      onComplete: () => {
        enterBlock.remove();
      }
    }, "+=1.5");
  });
});

(function () {
    const animateNumber = (element, target, duration, callback) => {
        let startTime;
        const initialNumber = 0;

        const cubicBezier = (t, p0, p1, p2, p3) => {
            const u = 1 - t;
            return 3 * u * u * t * p1 + 3 * u * t * t * p2 + t * t * t * p3;
        };

        const easingFunction = t => cubicBezier(t, 0, 0.645, 0.355, 1);

        const animate = time => {
            if (!startTime) startTime = time;
            const elapsedTime = time - startTime;
            const t = Math.min(elapsedTime / duration, 1);
            const easedT = easingFunction(t);
            const newValue = initialNumber + (target - initialNumber) * easedT;

            const roundedValue = Math.floor(newValue);

            if (parseInt(element.textContent, 10) !== roundedValue) {
                element.textContent = roundedValue;
            }

            if (elapsedTime < duration) {
                requestAnimationFrame(animate);
            } else {
                element.textContent = target;
                if (callback) callback();
            }
        };

        requestAnimationFrame(animate);
    };

    const onIntersection = entries => {
        entries.forEach(entry => {
            if (entry.isIntersecting) {
                const el = entry.target;
                const finalNumber = parseInt(el.getAttribute("data-final-number"), 10);
                const animDuration = 3250;

                el.textContent = "0";

                setTimeout(() => {
                    animateNumber(el, finalNumber, animDuration, () => {
                        setTimeout(() => {
                            document.querySelectorAll(".preloader_load-text-big, .preloader_load-text-small").forEach(text => {
                                text.style.transform = "translateY(100%)";
                                text.style.opacity = "0";
                            });
                        }, 250);

                    });
                }, 250);

                counterObserver.unobserve(el);
            }
        });
    };

    const counterObserver = new IntersectionObserver(onIntersection);

    document.addEventListener("DOMContentLoaded", () => {
        document.querySelectorAll('[counter-element="number"]').forEach(el => {
            el.setAttribute("data-final-number", el.textContent);
            el.textContent = "0";
            counterObserver.observe(el);
        });
    });
})();

document.addEventListener("scroll", () => {
  const scrollHeight = document.documentElement.scrollHeight - document.documentElement.clientHeight;
  const scrollTop = window.scrollY;
  const scrollPercent = Math.min((scrollTop / scrollHeight) * 100, 100);

  document.querySelectorAll(".progress-bar-wrap").forEach((progressBarWrap) => {
    const dot1 = progressBarWrap.querySelector(".progresbar_dot-1");
    const line = progressBarWrap.querySelector(".progress_line .progress_time-line");
    const dot2 = progressBarWrap.querySelector(".progresbar_dot-2");

    if (scrollPercent <= 3) {
      gsap.set(dot1, { backgroundColor: "#393736" });
    }

    if (scrollPercent > 3 && scrollPercent <= 10) {
      gsap.to(dot1, {
        backgroundColor: "#A6A19D",
        duration: 0.2,
        overwrite: "auto"
      });
    }

    if (scrollPercent > 10 && scrollPercent <= 95) {
      const heightPercent = ((scrollPercent - 10) / 85) * 100;
      gsap.set(line, { height: `${heightPercent}%` });
    }

    if (scrollPercent >= 99.9) {
      gsap.set(line, { height: "100%" });
    }

    if (scrollPercent <= 10) {
      gsap.set(line, { height: "0%" });
    }

    if (scrollPercent > 95) {
      gsap.to(dot2, {
        backgroundColor: "#A6A19D",
        duration: 0.2,
        overwrite: "auto"
      });
    } else {
      gsap.to(dot2, {
        backgroundColor: "#393736",
        duration: 0.2,
        overwrite: "auto"
      });
    }
  });
});

document.addEventListener("DOMContentLoaded", initNavbar);

function initNavbar() {
  const elements = {
    navButton: document.querySelector(".nav_button"),
    closeTriggers: document.querySelectorAll("[nav-close-trigger]"),
    hoverPairs: [
      {
        trigger: document.querySelector("[anturax-nav-hover]"),
        from: document.querySelector(".nav_content-left"),
        to: document.querySelector(".nav_content-left-2"),
      },
      {
        trigger: document.querySelector("[oraniths-nav-hover]"),
        from: document.querySelector(".nav_content-right"),
        to: document.querySelector(".nav_content-right-2"),
      }
    ]
  };

  if (elements.navButton) {
    document.addEventListener("click", (e) => {
      if (e.target.closest("[nav-close-trigger]")) {
        elements.navButton.click();
      }
    });

    document.addEventListener("keydown", (e) => {
      if (e.key === "Escape") {
        const isVisible = Array.from(elements.closeTriggers).some(
          el => el.offsetParent !== null
        );
        if (isVisible) {
          elements.navButton.click();
        }
      }
    });
  }

  elements.hoverPairs.forEach(({ trigger, from, to }) => {
    if (trigger && from && to) {
      bindOpacityToggle(trigger, from, to);
    }
  });
}

function bindOpacityToggle(trigger, from, to) {
  trigger.addEventListener("mouseenter", () => {
    gsap.set(from, { opacity: 0, overwrite: "auto" });
    gsap.set(to, { opacity: 1, overwrite: "auto" });
  });

  trigger.addEventListener("mouseleave", () => {
    gsap.set(from, { opacity: 1, overwrite: "auto" });
    gsap.set(to, { opacity: 0, overwrite: "auto" });
  });
}

document.addEventListener("DOMContentLoaded", function () {
  if (window.innerWidth <= 768) return;

  const xCoord = document.getElementById("x-coordinate");
  const yCoord = document.getElementById("y-coordinate");

  let mouseX = 0;
  let mouseY = 0;
  let lastX = -1;
  let lastY = -1;
  let ticking = false;

  function formatNumber(num) {
    return num.toString().padStart(4, "0");
  }

  function updateCoordinates() {
    if (mouseX !== lastX || mouseY !== lastY) {
      xCoord.textContent = formatNumber(mouseX % 10000);
      yCoord.textContent = formatNumber(mouseY % 10000);
      lastX = mouseX;
      lastY = mouseY;
    }
    ticking = false;
  }

  document.addEventListener("mousemove", (event) => {
    mouseX = event.clientX;
    mouseY = event.clientY;

    if (!ticking) {
      ticking = true;
      requestAnimationFrame(updateCoordinates);
    }
  });
});

const container = document.getElementById("webglContainer");
const collectionButton = document.querySelector('[collection-button="2"]');

const images = {
  1: "https://cdn.prod.website-files.com/675835c7f4ae1fa1a79b3733/67c6b3bb846631fc97e4d6e3_658938bdc8e942f531f832e90115063c_collections-oraniths.webp",
  2: "https://cdn.prod.website-files.com/675835c7f4ae1fa1a79b3733/67d981fb252db636a62ada10_9fe515e30f59684f5ddbdef1174d5129_collections-anturax-v2.webp",
};

let scene, camera, renderer, material, plane;
let textures = {};
let activeTexture = 1;
let transitionTexture = null;
let progress = 1;
let isAnimating = false;

function initWebGL() {
  scene = new THREE.Scene();
  camera = new THREE.PerspectiveCamera(45, 1, 0.1, 100);
  camera.position.set(0, 0, 10); 

  renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true }); 
  renderer.setSize(container.clientWidth, container.clientHeight);
  container.appendChild(renderer.domElement);

  const loader = new THREE.TextureLoader();
  let loaded = 0;

  Object.keys(images).forEach((key) => {
    loader.load(images[key], (texture) => {
      texture.minFilter = THREE.LinearFilter;
      texture.magFilter = THREE.LinearFilter;
      textures[key] = texture;
      loaded++;

      if (loaded === Object.keys(images).length) {
        createScene();
        animate();
        setInitialActiveLink();
        updateLottieVisibility(activeTexture);
      }
    });
  });
}
function createScene() {
  const vertexShader = `
    varying vec2 vUv;
    void main() {
      vUv = uv;
      gl_Position = projectionMatrix * modelViewMatrix * vec4(position, 1.0);
    }
  `;

  const fragmentShader = `
    uniform float uTime;
    uniform vec3 uFillColor;
    uniform float uProgress;
    uniform float uType;
    uniform float uPixels[36];
    uniform vec2 uTextureSize;
    uniform vec2 uElementSize;
    uniform sampler2D uTexture;
    varying vec2 vUv;

    vec2 fade(vec2 t) {return t*t*t*(t*(t*6.0-15.0)+10.0);}
    vec4 permute(vec4 x){return mod(((x*34.0)+1.0)*x, 289.0);}
    vec4 taylorInvSqrt(vec4 r){return 1.79284291400159 - 0.85373472095314 * r;}
    vec3 fade3(vec3 t) {return t*t*t*(t*(t*6.0-15.0)+10.0);}

    float mapf(float value, float min1, float max1, float min2, float max2) {
      float val = min2 + (value - min1) * (max2 - min2) / (max1 - min1);
      return clamp(val, min2, max2);
    }

    float quadraticInOut(float t) {
      float p = 2.0 * t * t;
      return t < 0.5 ? p : -p + (4.0 * t) - 1.0;
    }

    void main() {
      vec2 uv = vUv - vec2(0.5, 0.5);
      float aspect1 = uTextureSize.x / uTextureSize.y;
      float aspect2 = uElementSize.x / uElementSize.y;
      if (aspect1 > aspect2) {
        uv *= vec2(aspect2 / aspect1, 1.0);
      } else {
        uv *= vec2(1.0, aspect1 / aspect2);
      }
      uv += vec2(0.5, 0.5);

      vec4 defaultColor = texture2D(uTexture, uv);

      if (uType == 3.0) {
        float progress = quadraticInOut(1.0 - uProgress);
        float s = 50.0;
        float imageAspect = uTextureSize.x / uTextureSize.y;
        vec2 gridSize = vec2(
          s,
          floor(s / imageAspect)
        );

        float v = smoothstep(0.0, 1.0, vUv.y + sin(vUv.x * 4.0 + progress * 6.0) * mix(0.3, 0.1, abs(0.5 - vUv.x)) * 0.5 * smoothstep(0.0, 0.2, progress) + (1.0 - progress * 2.0));
        float mixnewUV = (vUv.x * 3.0 + (1.0 - v) * 50.0) * progress;
        vec2 subUv = mix(uv, floor(uv * gridSize) / gridSize, mixnewUV);

        vec4 color = texture2D(uTexture, subUv);
        color.a = mix(1.0, pow(v, 5.0), step(0.0, progress));
        color.a = pow(v, 1.0);
        color.rgb = mix(color.rgb, uFillColor, smoothstep(0.5, 0.0, abs(0.5 - color.a)) * progress);
        gl_FragColor = color;
      }
      gl_FragColor.rgb = pow(gl_FragColor.rgb, vec3(1.0 / 1.2));
    }
  `;

  material = new THREE.ShaderMaterial({
    vertexShader,
    fragmentShader,
    uniforms: {
      uTime: { value: 0 },
      uFillColor: { value: new THREE.Color("#070707") },
      uProgress: { value: 1 },
      uType: { value: 3 },
      uPixels: { value: new Float32Array(
        [1, 1.5, 2, 2.5, 3, 1, 1.5, 2, 2.5, 3, 3.5, 4, 2, 2.5, 3, 3.5, 4, 4.5, 5,
         5.5, 6, 3, 3.5, 4, 4.5, 5, 5.5, 6, 6.5, 7, 7.5, 8, 8.5, 9, 20, 100].map(v => v / 100)) },
      uTextureSize: { value: new THREE.Vector2(1, 1) },
      uElementSize: { value: new THREE.Vector2(1, 1) },
      uTexture: { value: textures[activeTexture] },
    },
    transparent: true,
  });

  material.uniforms.uTextureSize.value.set(
    textures[activeTexture].image.width,
    textures[activeTexture].image.height
  );

  const geometry = new THREE.PlaneGeometry(8, 8);
  plane = new THREE.Mesh(geometry, material);
  plane.position.set(0, 0, 0); 
  scene.add(plane);
}
function animate() {
  requestAnimationFrame(animate);
  renderer.render(scene, camera);
  updateTransition();
}

function updateTransition() {
  if (transitionTexture !== null && isAnimating) {
    progress += 0.0225;

    if (progress > 0.1 && material.uniforms.uTexture.value !== textures[transitionTexture]) {
      material.uniforms.uTexture.value = textures[transitionTexture];
      material.uniforms.uTextureSize.value.set(
        textures[transitionTexture].image.width,
        textures[transitionTexture].image.height
      );
    }

    if (progress >= 1) {
  progress = 1;
  activeTexture = transitionTexture;
  transitionTexture = null;
  isAnimating = false;
  updateLottieVisibility(activeTexture); 
}

    material.uniforms.uProgress.value = progress;
  }
}

