  function clamp(number, min, max) {
    return Math.max(min, Math.min(number, max));
  }

  class Sketch {
    constructor(options) {
      this.container = options.dom;
      this.img = this.container.querySelector("img");
      this.scene = new THREE.Scene();
      this.width = this.container.offsetWidth;
      this.height = this.container.offsetHeight;
      this.renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });
      this.renderer.setPixelRatio(Math.min(window.devicePixelRatio, 2));
      this.renderer.setSize(this.width, this.height);
      this.renderer.setClearColor(0xeeeeee, 0);
      this.renderer.physicallyCorrectLights = true;
      this.renderer.outputEncoding = THREE.sRGBEncoding;

      this.renderer.domElement.style.opacity = "0";
      this.renderer.domElement.style.transition = "opacity 1s ease-out";

      this.container.appendChild(this.renderer.domElement);

      this.camera = new THREE.OrthographicCamera(
        this.width / -2,
        this.width / 2,
        this.height / 2,
        this.height / -2,
        -1000,
        1000
      );
      this.camera.position.set(0, 0, 2);

      this.time = 0;
      this.mouse = { x: 0, y: 0, prevX: 0, prevY: 0, vX: 0, vY: 0 };
      this.isPlaying = true;

      this.settings = {
        grid: 50,
        mouse: 0.14,
        strength: 1,
        relaxation: 0.9,
      };

      this.addObjects();
      this.resize();
      this.setupResize();
      this.mouseEvents();

      requestAnimationFrame(() => {
        this.renderer.domElement.style.opacity = "1";
      });
    }

    setupResize() {
      window.addEventListener("resize", this.resize.bind(this));
    }

    resize() {
      this.width = this.container.offsetWidth;
      this.height = this.container.offsetHeight;
      this.renderer.setSize(this.width, this.height);
      this.camera.left = this.width / -2;
      this.camera.right = this.width / 2;
      this.camera.top = this.height / 2;
      this.camera.bottom = this.height / -2;
      this.camera.updateProjectionMatrix();

      if (this.plane) {
        this.plane.scale.set(this.width, this.height, 1);
      }
      this.regenerateGrid();
    }

    regenerateGrid() {
      this.size = this.settings.grid;
      const size = this.size * this.size;
      const data = new Float32Array(3 * size);

      for (let i = 0; i < size; i++) {
        const stride = i * 3;
        data[stride] = Math.random() * 255 - 125;
        data[stride + 1] = Math.random() * 255 - 125;
        data[stride + 2] = 0;
      }

      this.texture = new THREE.DataTexture(
        data,
        this.size,
        this.size,
        THREE.RGBFormat,
        THREE.FloatType
      );
      this.texture.magFilter = this.texture.minFilter = THREE.NearestFilter;

      if (this.material) {
        this.material.uniforms.uDataTexture.value = this.texture;
        this.material.uniforms.uDataTexture.value.needsUpdate = true;
      }
    }

    addObjects() {
  this.regenerateGrid();

  const loader = new THREE.TextureLoader();
  loader.load(this.img.src, (texture) => {
    texture.needsUpdate = true;

    this.material = new THREE.ShaderMaterial({
      extensions: {
        derivatives: "#extension GL_OES_standard_derivatives : enable",
      },
      side: THREE.DoubleSide,
      uniforms: {
        time: { value: 0 },
        resolution: {
          value: new THREE.Vector4(this.width, this.height, 1, 1),
        },
        uTexture: { value: texture },
        uDataTexture: { value: this.texture },
      },
      vertexShader: `
        varying vec2 vUv;
        void main() {
          vUv = uv;
          gl_Position = projectionMatrix * modelViewMatrix * vec4(position, 1.0);
        }
      `,
      fragmentShader: `
        uniform sampler2D uDataTexture;
        uniform sampler2D uTexture;
        uniform vec4 resolution;
        varying vec2 vUv;
        void main() {
          vec2 newUV = (vUv - vec2(0.5)) * resolution.zw + vec2(0.5);
          vec4 offset = texture2D(uDataTexture, vUv);
          gl_FragColor = texture2D(uTexture, newUV - 0.02 * offset.rg);
        }
      `,
    });

    this.geometry = new THREE.PlaneGeometry(1, 1, 1, 1);
    this.plane = new THREE.Mesh(this.geometry, this.material);
    this.plane.scale.set(this.width, this.height, 1);
    this.scene.add(this.plane);
    this.render();
  });
}



    updateDataTexture() {
      const data = this.texture.image.data;
      for (let i = 0; i < data.length; i += 3) {
        data[i] *= this.settings.relaxation;
        data[i + 1] *= this.settings.relaxation;
      }

      const gridMouseX = this.size * this.mouse.x;
      const gridMouseY = this.size * this.mouse.y;
      const maxDist = this.size * this.settings.mouse;
      const aspect = this.height / this.width;

      for (let i = 0; i < this.size; i++) {
        for (let j = 0; j < this.size; j++) {
          const distance =
            (gridMouseX - i) ** 2 / aspect + (gridMouseY - j) ** 2;
          const maxDistSq = maxDist ** 2;

          if (distance < maxDistSq) {
            const index = 3 * (i + this.size * j);
            const power = maxDist / Math.sqrt(distance);
            const clampedPower = clamp(power, 0, 10);
            data[index] +=
              this.settings.strength * 100 * this.mouse.vX * clampedPower;
            data[index + 1] -=
              this.settings.strength * 100 * this.mouse.vY * clampedPower;
          }
        }
      }

      this.mouse.vX *= 0.9;
      this.mouse.vY *= 0.9;
      this.texture.needsUpdate = true;
    }

    mouseEvents() {
      window.addEventListener("mousemove", (e) => {
        const rect = this.container.getBoundingClientRect();
        this.mouse.x = (e.clientX - rect.left) / this.width;
        this.mouse.y = 1 - (e.clientY - rect.top) / this.height;
        this.mouse.vX = this.mouse.x - this.mouse.prevX;
        this.mouse.vY = this.mouse.y - this.mouse.prevY;
        this.mouse.prevX = this.mouse.x;
        this.mouse.prevY = this.mouse.y;
      });
    }

    render() {
      if (!this.isPlaying) return;
      this.time += 0.05;
      this.updateDataTexture();
      this.material.uniforms.time.value = this.time;
      requestAnimationFrame(this.render.bind(this));
      this.renderer.render(this.scene, this.camera);
    }
  }

  document.addEventListener("DOMContentLoaded", () => {
    const observer = new IntersectionObserver(
      (entries, obs) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            new Sketch({ dom: entry.target });
            obs.unobserve(entry.target);
          }
        });
      },
      {
        rootMargin: "0px 0px 350% 0px",
        threshold: 0.1,
      }
    );

    document
      .querySelectorAll('[id^="canvasContainer"]')
      .forEach((container) => {
        observer.observe(container);
      });
  });

document.addEventListener("DOMContentLoaded", () => {
  const section = document.querySelector(".section_gallery");
  const items = document.querySelectorAll(".marquee-item");

  let isSectionVisible = false;
  let animationFrameId = null;

  function updateScale() {
    const isDesktop = window.innerWidth > 991;
    const baseScale = isDesktop ? 1 : 1.25;

    if (!isDesktop) {
      items.forEach((item) => {
        item.style.transform = `scale(${baseScale})`;
      });
      return;
    }

    const screenCenter = window.innerWidth / 2;

    items.forEach((item) => {
      const itemRect = item.getBoundingClientRect();
      const itemCenter = itemRect.left + itemRect.width / 2;

      const distanceFromCenter = Math.abs(screenCenter - itemCenter);
      const maxDistance = window.innerWidth * 0.4;

      const scale = baseScale + (1.5 - baseScale) * (1 - Math.min(distanceFromCenter / maxDistance, 1));
      item.style.transform = `scale(${scale})`;
    });
  }

  function animate() {
    if (!isSectionVisible) return;
    updateScale();
    animationFrameId = requestAnimationFrame(animate);
  }

  const observer = new IntersectionObserver((entries) => {
    entries.forEach((entry) => {
      isSectionVisible = entry.isIntersecting;
      if (isSectionVisible) {
        animate();
      } else {
        cancelAnimationFrame(animationFrameId);
      }
    });
  }, {
    threshold: 0.1
  });

  if (section) observer.observe(section);

  const resizeObserver = new ResizeObserver(() => {
    if (isSectionVisible) updateScale();
  });

  resizeObserver.observe(document.body);
  window.addEventListener("resize", () => {
    if (isSectionVisible) updateScale();
  });
});

