document.addEventListener('DOMContentLoaded', () => {
  const changeBg = document.querySelector('.change-bg');
  const sections = document.querySelectorAll('[section-bg]');
  const links = document.querySelectorAll('[data-collection-link]');
  const collectionsSection = document.getElementById('section-collections');
  const indexSection = document.getElementById('section-index');
  let isClickable = true;

  function updateBackground() {
    let currentBackground = '#FFDFC4';

    sections.forEach((section) => {
      const rect = section.getBoundingClientRect();

      if (rect.top <= window.innerHeight / 2 && rect.bottom >= window.innerHeight / 2) {
        const bgAttribute = section.getAttribute('section-bg');

        if (bgAttribute && bgAttribute.includes(',')) {
          const [color1, color2] = bgAttribute.split(',').map(color => color.trim());
          currentBackground = `radial-gradient(circle, ${color1} 0%, ${color2} 100%)`;
        } else {
          currentBackground = bgAttribute || currentBackground;
        }
      }
    });

    changeBg.style.background = currentBackground;
  }

  function handleLinkClick(event) {
    if (!isClickable) return;

    isClickable = false;
    setTimeout(() => {
      isClickable = true;
    }, 2000);

    const link = event.currentTarget;
    const newBgColor = link.getAttribute('section-bg');

    if (!newBgColor) return;

    if (collectionsSection) collectionsSection.setAttribute('section-bg', newBgColor);
    if (indexSection) indexSection.setAttribute('section-bg', newBgColor);

    updateBackground();
  }

  links.forEach(link => link.addEventListener('click', handleLinkClick));
  window.addEventListener('scroll', updateBackground);

  updateBackground();
});
